SELECT COUNT(cs_order_number) AS number_of_orders, SUM(cs_ext_ship_cost) AS total_shipping_costs, SUM(cs_net_profit) AS total_profits FROM catalog_sales JOIN customer_address ON cs_ship_addr_sk = ca_address_sk JOIN date_dim ON cs_sold_date_sk = d_date_sk WHERE d_date BETWEEN '2023-01-01' AND '2023-03-01' AND cs_warehouse_sk <> (SELECT w_warehouse_sk FROM warehouse WHERE w_warehouse_name = 'Primary Warehouse') AND cs_order_number NOT IN (SELECT cr_order_number FROM catalog_returns) AND ca_county IN ('County1', 'County2') AND ca_state IN ('State1', 'State2');
